import MainHeader from "../components/Home/MainHeader";
import Roplants from '../components/RoPlant/Roplants'

export default class Roplant extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <div>
        <MainHeader />
   <Roplants />
    </div>;
  }
}
